    //     <Line dataKey="student" stroke="red" activeDot={{ r: 8 }} />
    //     <Line
    //       type="monotone"
    //       dataKey="fees"
    //       stroke="green"
    //       activeDot={{ r: 8 }}
    //     />
    //   </LineChart>
    // </ResponsiveContainer>

    <ResponsiveContainer width="100%" aspect={3}>
      <LineChart
        data={pdata}
        width={500}
        height={800}
        margin={{ top: 15, right: 8, bottom: 2 }}
      >
        <CartesianGrid strokeDasharray="3 3" />

        <XAxis
          dataKey="name"
          interval={"preserveStartEnd"}
          tickFormatter={(value) => value + " Programming"}
        >
          <Label
            value="Programming Lang"
            position="insideBottom"
            offset={100}
          />
        </XAxis>
        <YAxis
          tickCount={9}
          label={{
            value: "student  data",
            angle: -90,
            position: "insideLeft",
          }}
        />
        <Tooltip contentStyle={{ backgroundColor: "yellow" }} />
        <Legend verticalAlign="bottom" />
        <Line
          type="monotone"
          dataKey="student"
          stroke="red"
          activeDot={{ r: 8 }}
        />
        <Line
          type="monotone"
          dataKey="fees"
          stroke="green"
          activeDot={{ r: 8 }}
        />
      </LineChart>
    </ResponsiveContainer>
  );
};

export default LineChartDiagram;
